import React from 'react';
import List from '../../components/List/List';
import AppContext from '../../context'

const NotesView = () => (
    <AppContext.Consumer>
        {(context) => (
            <List items={context.note}/>
        )}
    </AppContext.Consumer>
);

export default NotesView;
